import React from 'react';
import './About.css';

function About() {
  return (
    <section className="about" id="about">
      <h2>About Me</h2>
      <p>Welcome to my personal website. I am a young product manager looking to make strides in the industry. I am a rising third year at the University of Virginia, studying a Computer Science Bachelors and a Systems Engineering Masters.</p>
    </section>
  );
}

export default About;
